import "./UserProfileDetail.css";
const UserProfileDetail = () => {
  return (
    <>
      <main id="container2">
        <section>
          <h1 id="heading1">UserDetails</h1>
          <span id="userNameH">Name:</span>
          <span id="userName">ArumugaSelvam</span>
          <br></br>
          <span id="userEmailH">Email:</span>
          <span id="userEmail">selvam2305@gmail.com</span>
          <br></br>
          <span id="userNumberH">phoneNumber:</span>
          <span id="userNumber">2005200312</span>
          <button id="editProfilebtn">Edit Profile</button>
        </section>
      </main>
    </>
  );
};

export default UserProfileDetail;
